import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { SudokuGridComponent } from './components/sudoku-grid/sudoku-grid.component';
import { FormsModule } from '@angular/forms';
import { LoginRegisterComponent } from './components/login-register/login-register.component';
import { ReactiveFormsModule } from '@angular/forms';
import { RouterModule, Routes } from '@angular/router';
import { SudokuSolverComponent } from './components/sudoku-solver/sudoku-solver.component';
import { AuthGuard } from './service/auth/auth.guard';
import { NavbarComponent } from './components/navbar/navbar.component';
// const routes: Routes = [
//   { path: 'login', component: LoginRegisterComponent },
//   { path: 'sign_up', component: LoginRegisterComponent },
//   {
//     path: 'solve-sudoku',
//     component: SudokuSolverComponent,
//     canMatch: [AuthGuard],
//   },
//   { path: '', redirectTo: 'login', pathMatch: 'full' },
//   { path: '**', redirectTo: 'login' },
// ];
@NgModule({
  declarations: [
    AppComponent,
    SudokuGridComponent,
    LoginRegisterComponent,
    SudokuSolverComponent,
    NavbarComponent,
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule,
    ReactiveFormsModule,
    // RouterModule.forRoot(routes),
  ],
  providers: [],
  bootstrap: [AppComponent],
})
export class AppModule {}
